InterfaceAsPlainText.xhtml:
{attribute 'qualified_only'}
VAR_GLOBAL CONSTANT
	numAxis: LINT := 128;
	nameStringLength: LINT := 64;
END_VAR
VAR_GLOBAL
END_VAR

TYPE CylConfig :
STRUCT
	operateDelayTime: TIME;
	sensorDelayTime: TIME;
	cylinderErrorTime: TIME;
END_STRUCT
END_TYPE

TYPE CylInput :
STRUCT
	posFw AT %I*: BOOL;
	posRv AT %I*: BOOL;
END_STRUCT
END_TYPE

TYPE CylOutput :
STRUCT
	opeFw AT %Q*: BOOL;
	opeRv AT %Q*: BOOL;
END_STRUCT
END_TYPE

TYPE CylResource :
STRUCT
	input: CylInput;
	output: CylOutput;
	config: CylConfig;
	status: CylStatus;
END_STRUCT
END_TYPE

TYPE CylStatus :
STRUCT
	name: STRING(G.nameStringLength);
	opeFw: BOOL;
	opeRv: BOOL;
	posFw: BOOL;
	posRv: BOOL;
	ready: BOOL;
	busy: BOOL;
	done: BOOL;
	error: BOOL;
	errorCode: LINT;
	opePastTime: TIME;
END_STRUCT
END_TYPE

TYPE PBStatus :
STRUCT
	name: STRING(G.nameStringLength);
	pushed: BOOL;
END_STRUCT
END_TYPE

TYPE PBResource :
STRUCT
	input: PBInput;
	config: PBConfig;
	status: PBStatus;
END_STRUCT
END_TYPE

TYPE LPStatus :
STRUCT
	name: STRING(G.nameStringLength);
	on: BOOL;
END_STRUCT
END_TYPE

TYPE LPResource :
STRUCT
	output: LPOutput;
	config: LPConfig;
	status: LPStatus;
END_STRUCT
END_TYPE

FUNCTION_BLOCK Cyl
VAR_INPUT
	index: LINT;
	name: STRING(G.nameStringLength);
	opeFw: BOOL;
	opeRv: BOOL;
END_VAR
VAR_OUTPUT
	posFw: BOOL;
	posRv: BOOL;
	ready: BOOL;
	busy: BOOL;
	done: BOOL;
	error: BOOL;
END_VAR
VAR_IN_OUT
	resources: ARRAY[0..G.numAxis] OF CylResource;
END_VAR
VAR
	input: CylInput;
	output: CylOutput;
	config: CylConfig;
	status: CylStatus;
	rsErrorON: BOOL;
	rsErrorOFF: BOOL;
	cylErrorFw: BOOL;
	cylErrorRv: BOOL;
	TON_0: TON;
	TON_1: TON;
	TON_2: TON;
	TON_3: TON;
	TON_4: TON;
	TON_5: TON;
END_VAR

ST.xhtml:
Unit();


// 動作設定不一致を調べる
unmatchConfig := FALSE;
FOR i := 0 TO G.numAxis DO
	IF permConfigCyl[i].cylinderErrorTime <> cylinders[i].config.cylinderErrorTime THEN
		unmatchConfig := TRUE;
	END_IF
	IF permConfigCyl[i].operateDelayTime <> cylinders[i].config.operateDelayTime THEN
		unmatchConfig := TRUE;
	END_IF
	IF permConfigCyl[i].sensorDelayTime <> cylinders[i].config.sensorDelayTime THEN
		unmatchConfig := TRUE;
	END_IF
	IF permConfigPB[i].pushDelayTime <> PBs[i].config.pushDelayTime THEN
		unmatchConfig := TRUE;
	END_IF
	IF permConfigLP[i].invert <> LPs[i].config.invert THEN
		unmatchConfig := TRUE;
	END_IF
END_FOR


// 起動後初回に動作設定を元に戻す
IF firstScan THEN
	FOR i := 0 TO G.numAxis DO
		cylinders[i].config := permConfigCyl[i];
		PBs[i].config := permConfigPB[i];
		LPs[i].config := permConfigLP[i];
	END_FOR
END_IF


firstScan := FALSE;

InterfaceAsPlainText.xhtml:
PROGRAM MAIN
VAR
	// resources
	cylinders: ARRAY[0..G.numAxis] OF CylResource;
	PBs: ARRAY[0..G.numAxis] OF PBResource;
	LPs: ARRAY[0..G.numAxis] OF LPResource;

	// system
	firstScan: BOOL := TRUE;

	// 動作設定
	permConfigCyl: ARRAY[0..G.numAxis] OF CylConfig;
	permConfigPB: ARRAY[0..G.numAxis] OF PBConfig;
	permConfigLP: ARRAY[0..G.numAxis] OF LPConfig;
	i: LINT;
	unmatchConfig: BOOL := FALSE;
END_VAR

PROGRAM Unit
VAR
	stopperToUp: BOOL;
	stopperToDown: BOOL;	

	stopper: Cyl;
	fwButton: PB;
	rvButton: PB;

	unmatchConfigLamp: LP;
END_VAR

FUNCTION_BLOCK PB
VAR_INPUT
	index: LINT;
	name: STRING(G.nameStringLength);
END_VAR
VAR_OUTPUT
	pushed: BOOL;
END_VAR
VAR_IN_OUT
	resources: ARRAY[0..G.numAxis] OF PBResource;
END_VAR
VAR
	input: PBInput;
	config: PBConfig;
	status: PBStatus;
	TON_0: TON;
END_VAR

FUNCTION_BLOCK LP
VAR_INPUT
	index: LINT;
	name: STRING(G.nameStringLength);
	on: BOOL;
END_VAR
VAR_OUTPUT
END_VAR
VAR_IN_OUT
	resources: ARRAY[0..G.numAxis] OF LPResource;
END_VAR
VAR
	output: LPOutput;
	config: LPConfig;
	status: LPStatus;
END_VAR
